// 說好的 WooCommerce 教學文

 第一篇已經寫好囉，我們先從最簡單的安裝開始，裡面有分享幾個小眉角，都是我自己實作時碰到的狀況，有興趣的朋友也可以先嘗試安裝與新增商品 😊

 http://muki.tw/tech/woocommerce-install-and-use/

// 說好的 WooCommerce 教學文
// 最後一篇

 最後一篇跟大家介紹如何串歐付寶 (allpay)，但因為我沒辦法再做一組測試資料，所以步驟會有一些省略，請大家見諒。

 不過歐付寶的網站都寫得很清楚，我在這邊提供大家一些方向與概念，我相信喜歡折騰 WordPress 的你們，如此已經足夠 😊

 WooCommerce 系列教學文結束了，接下來希望還能有更多不同的經驗與實務分享給各位，感謝各位一路相隨 ❤️

 http://muki.tw/tech/woocommerce-allpay/

